  {
    this.callParms.reset ( );
    this.app.SSN_JEFE_FAM_GBL  = this.callParms.getDouble ( );
    this.app.form ( "REPORT_DSS171_RP" ).setItem ( "NOMBRE_JEFE_FAMILIA", this.callParms.getString ( ) );

  }
